import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaJs, FaPython, FaJava, FaCode, FaRuby } from 'react-icons/fa'; 
import './Skills.css';

const Skills = () => {
  const navigate = useNavigate();

  const goToFrameworks = () => {
    navigate('/frameworks');
  };

  return (
    <div className="skills-container">
      <h1>Add Your Skills</h1>
      <p>Pick your top 5 programming languages:</p>
      <div className="skills-icons">
        <label>
          <input type="checkbox" name="skills" value="JavaScript" />
          <FaJs className="icon" style={{ color: '#f0db4f' }} />
          JavaScript
        </label>
        <label>
          <input type="checkbox" name="skills" value="Python" />
          <FaPython className="icon" style={{ color: '#306998' }} />
          Python
        </label>
        <label>
          <input type="checkbox" name="skills" value="Java" />
          <FaJava className="icon" style={{ color: '#f89820' }} />
          Java
        </label>
        <label>
          <input type="checkbox" name="skills" value="C++" />
          <FaCode className="icon" style={{ color: '#00599c' }} />
          C++
        </label>
        <label>
          <input type="checkbox" name="skills" value="Ruby" />
          <FaRuby className="icon" style={{ color: '#cc342d' }} />
          Ruby
        </label>
      </div>
      <button onClick={goToFrameworks} className="next-button">
        Next: Frameworks
      </button>
    </div>
  );
};

export default Skills;
